import Header from "./components/Header";
import Footer from "./components/Footer";

function App() {
  return (
    <div className='container'>
      <Header title= 'Welcome'
        onShow={() => document.getElementById("myDropdown").classList.toggle("show")}/>

      <Footer />
    </div>
  );
}

export default App;
